import {
  PDFViewer,
  Document,
  Page,
  View,
  Text,
  Image,
} from '@react-pdf/renderer';

interface PapeletaSitioProps {
  papeleta: Array<{
    tipo: string;
    carroza?: string;
    id: string;
    nombre: string;
    sitio: string;
    pariente: string;
  }>;
}

export function PapeletaSitio({ papeleta }: PapeletaSitioProps) {
  const styleLabel = {
    width: '1.9cm',
    minWidth: '1.9cm',
  };
  const styleContent = {
    width: '8cm',
  };

  return (
    <PDFViewer style={{width: '100%', height: '100%'}}>
      <Document>
        <Page
          size="A4"
          style={{
            position: 'relative',
            display: 'flex',
            flexDirection: 'row',
            flexWrap: 'wrap',
            justifyContent: 'space-between',
          }}>
          {papeleta.map((p) => (
            <View
              key={p.id}
              style={{
                width: '10.5cm',
                height: '14cm',
                marginBottom: '0.5cm',
                transform: 'rotate(90deg)',
                display: 'flex',
                flexDirection: 'row',
                alignItems: 'center',
                fontSize: 9,
              }}>
              <View
                key={p.id}
                style={{
                  display: 'flex',
                  transform: 'rotate(270deg)',
                  alignItems: 'center',
                }}>
                <Image
                  src={logoBase64}
                  style={{
                    width: 130,
                    height: 60,
                  }}
                />
              </View>
              <View
                style={{ width: '10cm', marginLeft: '0.6cm', lineHeight: 0.9 }}>
                <View
                  style={{
                    display: 'flex',
                    flexDirection: 'row',
                    justifyContent: 'center',
                  }}>
                  <Text style={{ textDecoration: 'underline' }}>
                    Papeleta de {p?.tipo === 'carroza' ? 'Sitio' : 'Beduino'}
                  </Text>
                </View>
                <View
                  style={{
                    marginTop: '0.8cm',
                    display: 'flex',
                    flexDirection: 'row',
                  }}>
                  <Text style={styleLabel}>Carroza:</Text>
                  <Text style={styleContent}>{p?.carroza}</Text>
                </View>

                <View style={{ display: 'flex', flexDirection: 'row' }}>
                  <Text style={styleLabel}>Socio:</Text>
                  <Text style={styleContent}>
                    {p?.id} {p?.nombre?.toUpperCase()}{' '}
                  </Text>
                </View>

                <View style={{ display: 'flex', flexDirection: 'row' }}>
                  <Text style={styleLabel}>Asociado:</Text>
                  <Text style={styleContent}>{p?.pariente}</Text>
                </View>

                {p?.tipo === 'carroza' && (
                  <View style={{ display: 'flex', flexDirection: 'row' }}>
                    <Text style={styleLabel}>Ubicaci√≥n:</Text>
                    <Text style={styleContent}>{p?.sitio}</Text>
                  </View>
                )}
              </View>
            </View>
          ))}
        </Page>
      </Document>
    </PDFViewer>
  );
}

const logoBase64 =
  'data:image/png;base64,';
